import React from "react";
import '../styles/Abm.css';
import Navbar from "./Navbar";
import { useEffect, useState } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getInfo, registerOperation } from '../actions';
import Modal from 'react-modal';



Modal.setAppElement('#root');


export default function dbamanager() {
    return (
        <div className="div-main-abm">
            <Navbar />
            <h2>ABM de Operaciones</h2>
            <div className="div-balance-title div-abm-title">Registro de Operacion</div>
            <form  className="div-main-form">
                <label>titulo</label>
                <input name="titulo"  placeholder="Ingrese el titulo" type='text' ></input>
                <label>DESCRIPCION</label>
                <input name="descripcion"  placeholder="Ingrese la descripcion" type='text' ></input>
                <label>FECHA DE ESTRENO</label>
                <input name="fechadeEstreno" type='date'  ></input>
                <label>ESTRELLAS</label>
                <input name="estrellas"  placeholder="Ingrese los actores" type='number' ></input>
                <label>GENERO</label>
                <input name="genero"  placeholder="Ingrese el genero" type='text' step='0.01' ></input>
                <label>PRECIO DE ALQUILER</label>
                <input name="precioAlquiler" type='number'  ></input>
                <label>ATP</label>
                <input name="atp" checked={isChecked}  type='checkbox' ></input>
                <label>ESTADO</label>
                <input name="estado" type='text'  ></input>


                <button type="submit" className="button-form">Confirmar</button>
            </form>

        </div>
    )
}
